  const [isLogin, setIsLogin] = useState(true);
  const handleChange = (e) => {
    setIsLogin(e);
  };

  return (
    <>
      {!isLogin && <Auth />}
      {isLogin && (
        <div className="container">
          <div></div>
        </div>
      )}
    </>
  );
};

export default Account;
